def HEXLITTLEpack12_11_1(normal):
    normal1 = struct.unpack('!f', bytes.fromhex(little_to_bigEDIAN(normal[0])))[0]
    normal2 = struct.unpack('!f', bytes.fromhex(little_to_bigEDIAN(normal[1])))[0]
    normal3 = struct.unpack('!f', bytes.fromhex(little_to_bigEDIAN(normal[2])))[0]
    x = round(normal1 * 0x7ff) & 0xfff;
    y = round(normal2 * 0x3ff) & 0x7ff
    z = int(normal3 < 0)
    return threehex((x | (y << 12) | (z << 23)))
def twohex(sadnum):
    sadnum = hex(sadnum)[2:].rjust(2, '0')
    return sadnum
def threehex(sadnum):
    sadnum = hex(sadnum)[2:].rjust(6, '0')
    return sadnum
def little_to_bigEDIAN(hexstring):
    ba = bytearray.fromhex(hexstring)
    ba.reverse()
    sba = ''.join(format(x, '02x') for x in ba)
    abatwo = sba.upper()
    return abatwo


